import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div style={{ padding: 40 }}>
      <h1>CORRECTION_AUTO</h1>

      <Link to="/examen">
        <button>Mode Examen</button>
      </Link>
    </div>
  );
}

export default Home;
